    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="header">
        <div className="container-fluid">
          <div className="row">
            <div className="col-sm-3">
              <img
                src={require("./../../../images/terralogic.png")}
                className="picture-background"
              />
              <div className="col-sm-3 float-right">
                <p>dsafdas</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ProfilePage;
